import React from 'react'
import '../index.css';

function Experience() {
  return (
    <div className='bg-[#242422]'>
      <div className='Headings'>
        <h1 className='text-6xl font-bold text-center pt-20 text-[#38bdf8]'>Resume</h1>
        <h2 className='text-2xl text-center my-3 text-[#38bdf8]'>Some Of My Experience!</h2>
        <h3 className='flex justify-start'>Work Experience</h3>
      </div>
    </div>
  )
}

export default Experience
